import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';

function Home() {
  const [urls, setUrls] = useState([]);
  const navigate = useNavigate();

  useEffect(() => {
    axios.get('http://localhost:5000/urls')
      .then((res) => setUrls(res.data))
      .catch((err) => console.error('Error fetching URLs:', err));
  }, []);

  const goToAddUrl = () => {
    navigate('/add');
  };

  return (
    <div>
      <h2>Read Later List</h2>
      <button onClick={goToAddUrl}>âž• Add URL</button>
      <ul>
        {urls.map((item) => (
          <li key={item._id || item.url}>{item.title || item.url}</li>
        ))}
      </ul>
    </div>
  );
}

export default Home;
